package com.wavesplatform.zwaves;

import org.junit.Test;

import java.util.Arrays;
import java.util.Base64;

import static org.junit.Assert.*;

public class Bls12PedersenMerkleTreeTest {
    static {
        new JNILibrary("zwaves_jni", Bls12PedersenMerkleTree.class).load();
    }

    @Test
    public void test() {
        byte[] sibling = Base64.getDecoder().decode("");
        byte[] leaf = Base64.getDecoder().decode("");

        byte[] expected = Base64.getDecoder().decode("");

        byte[] output = Bls12PedersenMerkleTree.addItem(sibling, 0, leaf);

        assertArrayEquals(output, expected);

        byte[] wrongSibling = Base64.getDecoder().decode("");
        byte[] wrongLeaf = Base64.getDecoder().decode("");

        byte[] output1 = Bls12PedersenMerkleTree.addItem(wrongSibling, 0, leaf);
        byte[] output2 = Bls12PedersenMerkleTree.addItem(sibling, 0, wrongLeaf);
        byte[] output3 = Bls12PedersenMerkleTree.addItem(sibling, 1, wrongLeaf);

        assertEquals(0, output1.length);
        assertEquals(0, output2.length);
        assertEquals(0, output3.length);
    }
}